import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";

import image from "../photos/index/baelen.jpg";
import image2 from "../photos/index/bigbackdrop.jpg";

class Random extends Component {
  state = {};
  render() {
    return (
      <div>
        <Carousel>
          <Carousel.Item>
            <img src={image} alt="random" />
            <Carousel.Caption>
              <div>Item1</div>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default Random;
